import React from "react";
import { Link } from "react-router-dom";
import useData from "../../hooks/useData";

function CardItem() {
  const { locations } = useData("http://localhost:8000/blogs");
  const data = locations;
  return (
    <div>
      {data.map((places) => (
        <div key={places.id}>
          <li className="card">
            <Link className="card__link" to={places.path}>
              <figure className="card__picture">
                <img
                  src={places.src}
                  alt="travel-img"
                  className="card__image"
                />
              </figure>
              <div className="cards__info">
                <h5 className="card__text">{places.text}</h5>
              </div>
            </Link>
          </li>
        </div>
      ))}
    </div>
  );
}

export default CardItem;
